// src/pages/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('upload');
  const [mobiles, setMobiles] = useState([]);
  const [form, setForm] = useState({
    brand: '',
    model: '',
    ram: '',
    storage: '',
    price: '',
    condition: ''
  });
  const [image, setImage] = useState(null);

  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) {
      navigate('/login');
      return;
    }

    const fetchMobiles = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/mobiles', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setMobiles(res.data);
      } catch (err) {
        console.error('Error fetching mobiles:', err);
      }
    };

    fetchMobiles();
  }, [token, navigate]);

  const handleUpload = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    Object.entries(form).forEach(([key, value]) => formData.append(key, value));
    formData.append('image', image);

    try {
      await axios.post('http://localhost:5000/api/mobiles/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`
        }
      });

      alert('âœ… Mobile uploaded successfully!');
      setForm({ brand: '', model: '', ram: '', storage: '', price: '', condition: '' });
      setImage(null);

      const res = await axios.get('http://localhost:5000/api/mobiles', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(res.data);

    } catch (err) {
      console.error('Upload failed:', err);
      alert('âŒ Failed to upload mobile');
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Delete this mobile?')) return;

    try {
      await axios.delete(`http://localhost:5000/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(mobiles.filter((m) => m._id !== id));
    } catch (err) {
      console.error('Delete failed:', err);
      alert('âŒ Failed to delete mobile');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div className="admin-dashboard">
      {/* Internal Admin Navbar */}
      <div className="admin-navbar">
        <div className="admin-logo">ðŸ“± JollyBaba Admin</div>
        <div className="admin-tabs">
          <button className={activeTab === 'upload' ? 'active' : ''} onClick={() => setActiveTab('upload')}>Upload Mobile</button>
          <button className={activeTab === 'manage' ? 'active' : ''} onClick={() => setActiveTab('manage')}>Manage Mobiles</button>
          <button className="logout-btn" onClick={handleLogout}>Logout</button>
        </div>
      </div>

      {/* Upload Section */}
      {activeTab === 'upload' && (
        <form className="upload-form" onSubmit={handleUpload}>
          <h2>ðŸ“¤ Upload Mobile</h2>
          <input type="text" placeholder="Brand" value={form.brand} onChange={(e) => setForm({ ...form, brand: e.target.value })} required />
          <input type="text" placeholder="Model" value={form.model} onChange={(e) => setForm({ ...form, model: e.target.value })} required />
          <input type="text" placeholder="RAM" value={form.ram} onChange={(e) => setForm({ ...form, ram: e.target.value })} required />
          <input type="text" placeholder="Storage" value={form.storage} onChange={(e) => setForm({ ...form, storage: e.target.value })} required />
          <input type="number" placeholder="Price" value={form.price} onChange={(e) => setForm({ ...form, price: e.target.value })} required />
          <input type="text" placeholder="Condition" value={form.condition} onChange={(e) => setForm({ ...form, condition: e.target.value })} required />
          <input type="file" onChange={(e) => setImage(e.target.files[0])} required />
          <button type="submit">Upload</button>
        </form>
      )}

      {/* Manage Section */}
      {activeTab === 'manage' && (
        <div className="mobile-list">
          <h2>ðŸ“± Uploaded Mobiles</h2>
          {mobiles.length === 0 ? (
            <p>No mobiles uploaded yet.</p>
          ) : (
            mobiles.map((mobile) => (
              <div key={mobile._id} className="mobile-card">
                <img src={mobile.imageUrl} alt={mobile.model} />
                <div>
                  <h3>{mobile.brand} - {mobile.model}</h3>
                  <p>{mobile.ram} / {mobile.storage}</p>
                  <p>{mobile.condition} - â‚¹{mobile.price}</p>
                  <button onClick={() => handleDelete(mobile._id)}>ðŸ—‘ Delete</button>
                </div>
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
